def entrance(l: list, strict: bool=True):
    if len(l) < 2:
        return True
    dir = l[1] - l[0]
    for i in range(2, len(l)):
        if not dir:
            dir = l[i] - l[i - 1]
        if strict and dir == 0:
            return False
        if dir > 0:
            if l[i] - l[i - 1] < 0:
                return False
        elif strict and l[i] - l[i - 1] <= 0:
            return False
        if dir < 0:
            if l[i] - l[i - 1] > 0:
                return False
        elif strict and l[i] - l[i - 1] >= 0:
            return False
    return True

